import user from '.../user.json';

<Profile
  username={user.username}
  tag={user.tag}
  location={user.location}
  avatar={user.avatar}
  stats={user.stats}
/>;

const Container = () => {
  return (
    <div className="Container">
      <Profile />
    </div>
  );
};
